import { HTMLMorph } from "lively.morphic";
import { debounceNamed, waitForAll } from "lively.lang/function.js";
import { loadViaScript } from "lively.resources/index.js";

import { clone } from "lively.lang/object.js";
import { batchify, flatten } from "lively.lang/array.js";
import { delay, waitFor } from "lively.lang/promise.js";

export default class GoogleMaps extends HTMLMorph {

  static get properties() {
    return {

      draggable: {},

      mapState: {
        after: [],

        initialize() {
          this.mapState = {
            __dont_serialize__: ['map', 'markers', 'polylines'],
            map: null,
            markers: [],
            polylines: [],
            canvasId: "map-canvas-" + this.id,
            mapOptions: {
              // Bay area
              center: {lat: 37.6195297039513, lng: 237.68678945922852},
              zoom: 10,
              mapTypeId: 'roadmap'
            },
            ...this.mapState
          }
        }
      },

      zoom: {
        derived: true, after: ["mapState"],
        get() { let {map} = this.mapState; return map ? map.getZoom() : 1; },
        set(val) {
          waitFor(15000, () => this.mapState.map).then(map => map.setZoom(val));
        },
      },

      gmaps: {
        derived: true, readOnly: true,
        get() { return window.google ? window.google.maps : null; }
      },

      gevent: {
        derived: true, readOnly: true, after: ["gmaps"],
        get() { let {gmaps} = this; return gmaps ? gmaps.event : null; }
      },

      extent: {
        set(val) {
          this.setProperty("extent", val);
          waitFor(15000, () => this.mapState.map)
            .then(map => debounceNamed('on-map-resize-' + this.id, 200, () =>
                    window.google.maps.event.trigger(map, 'resize'))());
        }
      }
    }
  }


  __serialize__(pool, serializedObjMap, path) {
    // c=this.copy()
    var s = this.mapState
    if (s.map) {
      var map = s.map, opts = s.mapOptions, center = map.getCenter();
      opts.center = {lng: center.lng(), lat: center.lat()};
      opts.mapTypeId = s.map.getMapTypeId();
      opts.zoom = s.map.getZoom();
    }
    return null;
  }

  onLoad() {
    this.init();
  }

  async init() {
    try {
      this.reset();
      await this.loadGoogleMapsAPI();
      await this.loadMap()
    } catch (err) {
      console.error(`Error initializing google maps:`, err);
    }
  }

  reset() {
    if (this.mapState.map) this.gevent.clearInstanceListeners(this.mapState.map);
    if (this.mapState.markers && this.mapState.markers.length) this.removeAllMarkers();
    if (this.mapState.polylines && this.mapState.polylines.length) this.removeAllPolylines();
    this.propertiesAndPropertySettings().properties.mapState.initialize.call(this)
    this.mapState.canvasId = "map-canvas-" + this.id;
    this.html = '<div style="height:100%" id="' + this.mapState.canvasId + '"/>';
    this.name = 'GoogleMapsCanvas';

    // this.getWindow().copyToPartsBinWithUserRequest()
  }

  ensureMapOptions(mapState) {
    // mapState = this.mapState

    let {gmaps} = this;
    if (!this.gmaps) return null;
    var opts = {...mapState.mapOptions};
    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
    // center
    if (!opts.center) {
      opts.center = new gmaps.LatLng(-34.397, 150.644);

    } else if (!(opts.center instanceof gmaps.LatLng)) {
      opts.center = new gmaps.LatLng(
        opts.center.lat || -34.397,
        opts.center.lng || 150.644);
    }
    // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
    // mapType
    if (!opts.mapTypeId) {
      opts.mapTypeId = gmaps.MapTypeId.ROADMAP;
    } else if (typeof opts.mapTypeId === "string") {
      opts.mapTypeId = gmaps.MapTypeId[opts.mapTypeId.toUpperCase()]
    }
    // misc
    opts.zoom = opts.zoom || 8;
    return opts;
  }


  async loadGoogleMapsAPI(attempt = 0) {
    if (attempt >= 1000)
      throw new Error(`Failed loading google maps`);

    // await this.init();
    if (!!this.gmaps) {
      if (!this.gmaps.Load) return; // loaded
      await delay(300); return this.loadGoogleMapsAPI(attempt + 1);
    }

    var initFuncName = 'google_maps_init';
    if (window[initFuncName]) {
      await delay(300); return this.loadGoogleMapsAPI(attempt + 1);
    }

    function initGoogle() {
      console.log('Google Maps API loaded');
      delete window[initFuncName];
    }
    window[initFuncName] = initGoogle;
    var url = 'https://maps.googleapis.com/maps/api/js?'
            + 'libraries=geometry,places&'
            + 'key=AIzaSyCqIO22KtIs_lxhyhDJf-MpwvFIx8n9Z-4&'
            + 'sensor=false&callback=' + initFuncName;
    loadViaScript(url);
    await delay(100);
    return this.loadGoogleMapsAPI(attempt + 1);
  }

  loadMap() {
    if (typeof window.google === 'undefined') {
      return this.setStatusMessage(`Trying to initialize Google Map but `
                                 + `google API not loaded!`);
    }
    return waitFor(15000, () => document.getElementById(this.mapState.canvasId))
      .then(canvas => {
        let mapOptions = this.ensureMapOptions(this.mapState);
        this.mapState.map = new this.gmaps.Map(canvas, mapOptions);
      });
  }


  onOwnerChanged(newOwner) {
    if (!newOwner) return;
    if (!this.mapState.map) this.loadMap();
  }

  // -=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-=-
  // marker API

  addMarker(posOrMarker, options) {
    options = options || {};

    var marker,
        map = this.mapState.map,
        ev = this.gevent;

    if (posOrMarker instanceof this.gmaps.Marker) {
      marker = posOrMarker;
    } else {
      var pos = posOrMarker,
          latLng = pos instanceof this.gmaps.LatLng ?
          pos : new this.gmaps.LatLng(pos.lat || pos.latitude || pos.x, pos.lng || pos.longitude || pos.y);
      marker = new this.gmaps.Marker({position: latLng});
    }


    marker.setMap(map);
    if (!this.mapState.markers) this.mapState.markers = [];
    this.mapState.markers.push(marker);

    if (options.onMouseDown) {
      this.gevent.addListener(marker, 'click', function(evt) {
        options.onMouseDown(evt, marker);
      });
    }

    if (options.icon) marker.setIcon(options.icon);

    if (options.info) {
      marker.info = new this.gmaps.InfoWindow({content: options.info.content || options.info});

      if (options.info.hover) {
        ev.addListener(marker.info, 'closeclick', function () {
          marker.info.stayOpen = false;
        });
        ev.addListener(marker, 'mouseout', function () {
          if (!marker.info.stayOpen) marker.info.close();
        });
        ev.addListener(marker, 'mouseover', function () {
          marker.info.open(map, marker);
        });
        ev.addListener(marker, 'click', function () {
          marker.info.stayOpen = true;
        });
      } else {
        ev.addListener(marker, 'click', function () {
          marker.info.open(map, marker);
        });
      }
    }

    return marker;
  }


  addMarkerForAddress(addressString, options) {
    // this.addMarkerForAddress('1065 Greco Ave, Sunnyvale', {
    //         info: {content: 'test '.times(10), hover: true},
    //     onMouseDown: function(evt, marker, options) { show('click'); }})
    // this.removeAllMarkers()
    var gc = new this.gmaps.Geocoder();
    gc.geocode({address: addressString}, (result) => {
      if (!result || result.length == 0) {
        // alert('nothing found')
        return;
      }
      var pos = result[0].geometry.location;
      this.addMarker(pos, options);
    });
  }


  addMarkers(positions, opts) {
    positions.forEach((p) => {
      var posOpts = clone(opts || {});
      if (p.onMouseDown) {
        posOpts.onMouseDown = p.onMouseDown;
        delete p.onMouseDown;
      }
      if (p) this.addMarker(p, posOpts);
    });
  }

  addMarkersForAddresses(adresses, options) {
    adresses.forEach((ea, i) =>
      this.addMarkerForAddress(ea, options ? options[i]: {}));
  }

  addPolyline(pathOrPolyline, options) {

    var polyline;

    if (pathOrPolyline instanceof this.gmaps.Polyline) {
      polyline = pathOrPolyline;
    } else {
      // Polylines should be encoded as in https://developers.google.com/maps/documentation/utilities/polylineutility
      var path = pathOrPolyline;
      if (typeof path === "string") {
        path = this.gmaps.geometry.encoding.decodePath(path);
      }

      polyline = new this.gmaps.Polyline({
        path: path,
        geodesic: true,
        strokeColor: '#FF0000',
        strokeOpacity: 1.0,
        strokeWeight: 2
      });
    }

    if (!this.mapState.polylines) this.mapState.polylines = [];
    this.mapState.polylines.push(polyline);

    polyline.setMap(this.mapState.map);

    return polyline;
  }


  getElevationAlongPolyline(polyline, thenDo) {

    // Elevation service issue, see http://stackoverflow.com/questions/11420176/elevation-service-unknown-error
    // we need to break up path that are too long

    var batches = batchify(
          polyline.getPath().getArray(),
          function batchConstrained(batch) { return batch.length <= 200; }),
        samples = 256,
        samplesPerBatch  = Math.ceil(samples / batches.length),
        elevator = new this.gmaps.ElevationService();

    waitForAll(
      batches.map(function(batch) {

        var pathRequest = {
          'path': batch,
          'samples': samplesPerBatch
        }

        return function(n) {
          // withElevationDo(batch, {samples: samplesPerBatch}, n);
          elevator.getElevationAlongPath(pathRequest, function(results, status) {
            if (status != this.gmaps.ElevationStatus.OK) { n(status); }
            else n(null, results);
          });
        }
      }), (err, results) => thenDo(err, results && flatten(results)));
  }

  removeAllMarkers() {
    // this.removeAllMarkers();
    if (!this.mapState.markers || !this.mapState.markers.length) return;
    var m; while ((m = this.mapState.markers.shift())) {
      this.gevent.clearInstanceListeners(m);
      m.setMap(null);
    }
  }


  removeAllPolylines() {
    // this.removeAllMarkers();
    if (!this.mapState.polylines || !this.mapState.polylines.length) return;
    var m; while ((m = this.mapState.polylines.shift())) {
      this.gevent.clearInstanceListeners(m);
      m.setMap(null);
    }
  }


  removePolyline(polyline) {
    if (this.mapState.polylines) {
      this.mapState.polylines = this.mapState.polylines.without(polyline);
    }

    this.gevent.clearInstanceListeners(polyline);
    polyline.setMap(null);
  }

}
